import React from "react";
import Avatar from "./Avatar";
import Info from "./Info";

function note(props) {
  return ( <
    div className = "card" > < div className = "top" >
    <
    h1 className = "name" > {
      props.name
    } < /h1> <Avatar image={props.image} / > < /div> <
    Info tel = {
      props.tel
    }
    email = {
      props.email
    }
    />< /div >
  );
}

export default note;
